            int[] result = new int[s.length()];

            for (int i = 0; i < s.length(); i++) {
                if (s.charAt(i) == c) {
                    result[i] = 0;
                    continue;
                }
                int l = i--;
                int r = i++;
                while (l >= 0 || r < s.length()) {
