vector<int> shortestToChar(string s, char c) {
    vector<int> chars = {}, res = {};
    for (int i = 0; i < s.size(); ++i) {
        if (s[i] == c) {
            chars.push_back(i);
        }
    }
    int ptr = 0;
    for (int i = 0; i < s.size(); ++i) {
        if (ptr == chars.size() - 1) {
            res.push_back(fabs(i - chars[ptr]));
            continue;
        }
        int pre = fabs(i - chars[ptr]), next = fabs(i - chars[ptr + 1]);
        if (pre < next) {
            res.push_back(pre);
        } else {
            res.push_back(next);
            ++ptr;
        }
    }
    return res;
}
```
