        int len = num.length;
        for (int i = 0; i < len; ++i) {
            int a = num[len - i - 1];
            k = k + a;
            int b = k % 10;
            result.add(b);
            k = k / 10;
        }
        while (k != 0) {
            int a = k % 10;
            result.add(a);
            k = k / 10;
        }
        Collections.reverse(result);
        return result;
    }
}
